import React from 'react';
import Screen from './components/Screen/Screen'
import Button from './components/Button/Button'
import './App.css';

function App() {
  return (
    <main className='container'>
      <Screen />
      <Button text={'7'}/>
      <Button text={'8'}/>
      <Button text={'9'}/>
      <Button text={'÷'}/>
      <Button text={'⇐'}/>
    </main>
  );
}

export default App;
